  "translationLines": [
    {
      "lineNumber": 207562,
      "originalJapaneseLine": "　とーーーーう！",
      "translatedEnglishLine": "Heeeey!"
    },
    {
      "lineNumber": 207563,
      "originalJapaneseLine": "「ひゃああああ！？",
      "translatedEnglishLine": "\"Hyaaaa!?!\""
    },
    {
      "lineNumber": 207564,
      "originalJapaneseLine": "「止めなくていいの、お姉様？」",
      "translatedEnglishLine": "\"Aren't you going to stop him, big sister?\""
    },
    {
      "lineNumber": 207565,
      "originalJapaneseLine": "「好きにさせてやりなさい」",
      "translatedEnglishLine": "\"Let him do as he pleases.\""
    },
    {
      "lineNumber": 207566,
      "originalJapaneseLine": "「まったく……」",
      "translatedEnglishLine": "\"Good grief...\""
    },
    {
      "lineNumber": 207567,
      "originalJapaneseLine": "「浮かれちゃって、馬鹿ね」",
      "translatedEnglishLine": "\"So carefree, what a fool.\""
    },
    {
      "lineNumber": 207568,
      "originalJapaneseLine": "「で、ビスケッタさん。",
      "translatedEnglishLine": "\"So, Biscetta-san.\""
    },
    {
      "lineNumber": 207569,
      "originalJapaneseLine": "　ガキ共はここにいるんだな？」",
      "translatedEnglishLine": "The brats are here, right?\""
    },
    {
      "lineNumber": 207570,
      "originalJapaneseLine": "「はい、こちらの部屋に」",
      "translatedEnglishLine": "\"Yes, in this room.\""
    },
    {
      "lineNumber": 207571,
      "originalJapaneseLine": "「うむ……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 207572,
      "originalJapaneseLine": "「ほらほら、おとーさん。",
      "translatedEnglishLine": "\"Come on, dad.\""
    },
    {
      "lineNumber": 207573,
      "originalJapaneseLine": "　早くみんなに会ってあげて」",
      "translatedEnglishLine": "Hurry and go meet everyone.\""
    },
    {
      "lineNumber": 207574,
      "originalJapaneseLine": "「なに緊張してんのよ、らしくもない」",
      "translatedEnglishLine": "\"Why are you so nervous? That's not like you at all.\""
    },
    {
      "lineNumber": 207575,
      "originalJapaneseLine": "「や、やかましい。",
      "translatedEnglishLine": "\"S-shut up."
    },
    {
      "lineNumber": 207576,
      "originalJapaneseLine": "　俺様が緊張なぞするか」",
      "translatedEnglishLine": "\"There's no way I'd be nervous.\""
    },
    {
      "lineNumber": 207577,
      "originalJapaneseLine": "「ほらほら、お父さん。",
      "translatedEnglishLine": "\"Come on, dad."
    },
    {
      "lineNumber": 207578,
      "originalJapaneseLine": "　みんなも会いたがってるから」",
      "translatedEnglishLine": "Everyone wants to see you.\""
    },
    {
      "lineNumber": 207579,
      "originalJapaneseLine": "「だ、誰がお父さんだ！",
      "translatedEnglishLine": "\"W-who are you calling dad?!\""
    },
    {
      "lineNumber": 207580,
      "originalJapaneseLine": "　あ、いや、俺か……」",
      "translatedEnglishLine": "\"Ah, well, I guess that’s me...\""
    },
    {
      "lineNumber": 207581,
      "originalJapaneseLine": "「ふ、ふん、こんなもん、大したことないわ」",
      "translatedEnglishLine": "\"Hmph, this is nothing special.\""
    },
    {
      "lineNumber": 207582,
      "originalJapaneseLine": "「お、おーう！　ガキ共いるかー！」",
      "translatedEnglishLine": "\"Heeey! You brats, are you here?!\""
    },
    {
      "lineNumber": 207583,
      "originalJapaneseLine": "ランスがバーンと玉座の間の扉を開けた。",
      "translatedEnglishLine": "Rance slammed open the door between the throne room."
    },
    {
      "lineNumber": 207584,
      "originalJapaneseLine": "「うおっ、分かっていたが沢山いるな……」",
      "translatedEnglishLine": "\"Whoa, I knew there were a lot, but still...\""
    },
    {
      "lineNumber": 207585,
      "originalJapaneseLine": "室内にはランスの登場を待っていた",
      "translatedEnglishLine": "Inside, the children who had been waiting for Rance's arrival"
    },
    {
      "lineNumber": 207586,
      "originalJapaneseLine": "子供達がめいめい好きな場所で休んでいた。",
      "translatedEnglishLine": "were resting each in their favorite spots."
    },
    {
      "lineNumber": 207587,
      "originalJapaneseLine": "「ふーん、これが親父、ねえ……」",
      "translatedEnglishLine": "\"Hmm, so this is the old man, huh...\""
    },
    {
      "lineNumber": 207588,
      "originalJapaneseLine": "「どきどき……」",
      "translatedEnglishLine": "\"(Heartbeat...)\""
    },
    {
      "lineNumber": 207589,
      "originalJapaneseLine": "「ランス、褒めてあげて下さい」",
      "translatedEnglishLine": "\"Rance, please praise them.\""
    },
    {
      "lineNumber": 207590,
      "originalJapaneseLine": "「今回、この子達が自らの危険も省みず、",
      "translatedEnglishLine": "\"This time, these kids bravely risked themselves"
    },
    {
      "lineNumber": 207591,
      "originalJapaneseLine": "　ランスを目覚めさせてくれたのです」",
      "translatedEnglishLine": "to awaken Rance.\""
    },
    {
      "lineNumber": 207592,
      "originalJapaneseLine": "「む……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 207593,
      "originalJapaneseLine": "「ふ、ふん、どうして俺がそんなことを",
      "translatedEnglishLine": "\"Hmph, why should I be the one to do such a thing...\""
    },
    {
      "lineNumber": 207594,
      "originalJapaneseLine": "　してやらねばいかんのだ……」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 207595,
      "originalJapaneseLine": "「……照れてんの？」",
      "translatedEnglishLine": "\"...Are you embarrassed?\""
    },
    {
      "lineNumber": 207596,
      "originalJapaneseLine": "「ば、馬鹿言うな！」",
      "translatedEnglishLine": "\"D-don't be stupid!\""
    },
    {
      "lineNumber": 207597,
      "originalJapaneseLine": "「……ふんっ」",
      "translatedEnglishLine": "\"...Hmph.\""
    },
    {
      "lineNumber": 207598,
      "originalJapaneseLine": "「ど、どれ、一人一人の顔でも見てやるか」",
      "translatedEnglishLine": "\"W-well, I guess I'll look at each of your faces.\""
    },
    {
      "lineNumber": 207599,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "......"
    },
    {
      "lineNumber": 207600,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "......"
    },
    {
      "lineNumber": 207601,
      "originalJapaneseLine": "「お、おら――」",
      "translatedEnglishLine": "\"H-hey—\""
    },
    {
      "lineNumber": 207602,
      "originalJapaneseLine": "「どけ」",
      "translatedEnglishLine": "\"Move.\""
    },
    {
      "lineNumber": 207603,
      "originalJapaneseLine": "「うぎゃああああああ！！！！」",
      "translatedEnglishLine": "\"Ugyahhhhh!!!!\""
    },
    {
      "lineNumber": 207604,
      "originalJapaneseLine": "魔王キーック。",
      "translatedEnglishLine": "Demon King's Kick."
    },
    {
      "lineNumber": 207605,
      "originalJapaneseLine": "ロッキーはごろんごろんと壁まで吹き飛ばされた。",
      "translatedEnglishLine": "Rocky was sent flying, tumbling all the way to the wall."
    },
    {
      "lineNumber": 207606,
      "originalJapaneseLine": "「あれ俺のガキと違うだろう。",
      "translatedEnglishLine": "\"That one isn't my kid, right?"
    },
    {
      "lineNumber": 207607,
      "originalJapaneseLine": "　なんだ、今の？」",
      "translatedEnglishLine": "What was that just now?\""
    },
    {
      "lineNumber": 207608,
      "originalJapaneseLine": "「ロッキーさんだよぉ……」",
      "translatedEnglishLine": "\"That's Rocky-san...\""
    },
    {
      "lineNumber": 207609,
      "originalJapaneseLine": "「……なんかどっかで聞いたような名前だな」",
      "translatedEnglishLine": "\"...That name sounds familiar somehow.\""
    },
    {
      "lineNumber": 207610,
      "originalJapaneseLine": "「しくしく……",
      "translatedEnglishLine": "\"Sniffle...\""
    },
    {
      "lineNumber": 207611,
      "originalJapaneseLine": "　ランス様、相変わらずだす……」",
      "translatedEnglishLine": "Lord Rance is as usual...\""
    },
    {
      "lineNumber": 207612,
      "originalJapaneseLine": "「で、俺のガキは……」",
      "translatedEnglishLine": "\"So, what about my kid...?\""
    },
    {
      "lineNumber": 207613,
      "originalJapaneseLine": "「よう、親父。",
      "translatedEnglishLine": "\"Hey, old man."
    },
    {
      "lineNumber": 207614,
      "originalJapaneseLine": "　体はいいのか？」",
      "translatedEnglishLine": "How's your body?\""
    },
    {
      "lineNumber": 207615,
      "originalJapaneseLine": "「お前……ダークランス、だよな？」",
      "translatedEnglishLine": "\"You're... Dark Rance, right?\""
    },
    {
      "lineNumber": 207616,
      "originalJapaneseLine": "「ん？　見て分かんねぇか？」",
      "translatedEnglishLine": "\"Hmm? Can't you tell by looking?\""
    },
    {
      "lineNumber": 207617,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "......"
    },
    {
      "lineNumber": 207618,
      "originalJapaneseLine": "「……どした？」",
      "translatedEnglishLine": "\"...What's wrong?\""
    },
    {
      "lineNumber": 207619,
      "originalJapaneseLine": "「お前、俺そっくりではないか。",
      "translatedEnglishLine": "\"You look exactly like me.\""
    },
    {
      "lineNumber": 207620,
      "originalJapaneseLine": "　気持ち悪いぞ」",
      "translatedEnglishLine": "\"It's kinda creepy.\""
    },
    {
      "lineNumber": 207621,
      "originalJapaneseLine": "「はは……",
      "translatedEnglishLine": "\"Haha...\""
    }
  ]
}

